import React from "react";

const Note = ({ key, content, important }) => {
  const styles = {
    textDecoration: "underline"
  };

  return (
    <li key={key} style={important ? styles : null}>
      {content}{" "}
      <button>{important ? "make not important" : "important"}</button>
    </li>
  );
};
export default Note;
